import React from 'react'

class ShablonCard extends React.Component{
    render(){
        return(
            <div className = "groupbtn">
                <input id = "InPassword" placeholder = {"Введите пароль"}></input>
                <button id ="LoginButton" onClick={this.gotocreate}>Войти</button>
            </div>
        )
    }
    gotocreate () {
        console.log("Create");
    }
}

export default ShablonCard
